<script setup>
import FloatingConfigurator from '@/Components/FloatingConfigurator.vue';
import Toast from 'primevue/toast';
import { useToast } from 'primevue/usetoast';
import { ref } from 'vue';
import { Head, useForm } from '@inertiajs/vue3';
import InputText from 'primevue/inputtext';
import Password from 'primevue/password';
import Message from 'primevue/message';

const toast = useToast();
const form = useForm({
    email: '',
    password: '',
    remember: false,
});
const errText = ref('')
const errTitle = ref('')

const submit = async () => {
    if (form.email.length > 0 && form.password.length > 0) {
        if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(form.email)) {
            form.errors.email = ''
            form.post(route('login'), {
                onFinish: () => {
                    form.reset('password')
                },
            });
        } else {
            errTitle.value = 'Peringatan'
            errText.value = 'Format alamat email tidak valid!'
            showError()
            form.errors.email = 'The email field must be a valid email address.'
            // console.log(errText)
        }
    } else {
        errTitle.value = 'Peringatan'
        errText.value = 'Harap mengisi email dan password!'
        showError()
    }
}

const validateEmail = () => {
    if (form.email.length > 0) {
        if (/^\w+([\.-]?\w+)*@\w+([\.-]?\w+)*(\.\w{2,3})+$/.test(form.email)) {
            form.errors.email = ''
            // console.log('no error email')
        } else {
            form.errors.email = 'The email field must be a valid email address.'
            // console.log('error email')
        }
    }
}

const showError = () => {
    toast.add({ severity: 'error', summary: errTitle.value, detail: errText.value, life: 3000 });
}

const test = () => {
    console.log('test')
}

</script>

